import {
  winston,
  cron,
} from './nodebbs';

const CronJob = cron.CronJob;

async function checkUserLevel() {
  winston.info('lecode-markdown-ext:checkUserLevel&gt;');
}

/**
 * Starts the jobs.
 * @returns A promise that resolves when the jobs are started.
 */
function startJobs(): Promise&lt;void&gt; {
  console.info('lecode-markdown-ext:startJobs&gt; start jobs.');
  const job = new CronJob('*/30 * * * *', checkUserLevel, null, true);
  return job;
}


